import './App.css';
import Greet from './Components/Greet';
import Message from './Components/Message';
import Click from './Components/CLickHandler';

function App() {
  return (
    <div className="App">
      <Greet name = 'Rova' identity = 'Crush'/>
      <Message />
      <Click />
    </div>
  );
}

export default App;
